var title_f1_13_1237="Pelvic floor dyssynergia";
var content_f1_13_1237=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F54087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F54087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    Dyssynergic defecation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 307px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Defecation normally involves the coordinated relaxation of the puborectalis and external anal sphincter muscles as pressure is building in the rectum (control panel, left). However, in patients with dyssynergic defecation (patient panel, right), ineffective defecation is associated with a failure to relax, or inappropriate contraction of, the puborectalis and external anal sphincter muscles as pressure increases in the rectum.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Preston DM, Lennard-Jones JE, Dig Dis Sci 1985; 30:413.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
