var title_f1_13_1240="Histologic changes in thromboangiitis obliterans";
var content_f1_13_1240=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F59478&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F59478&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Histologic changes in thromboangiitis obliterans",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 350px; height: 470px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Three phases of thromboangiitis obliterans have been described pathologically. In the acute phase (shown above), occlusive inflammatory thrombus develop within the vessel. Polymorphonuclear leukocytes, micro-abscesses, and multinucleated giant cells may also be present. The intermediate phase is characterized by progressive organization of the thrombus. In the chronic phase, only organized thrombus and fibrosis remain; the inflammation is no longer present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rubin, E, Farber, JL. Pathology, 3rd Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 1999. Copyright &copy; 1999 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
