"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Historical clues to potential organic causes of failure to thrive (undernutrition) in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Historical clues",
"       </td>",
"       <td class=\"subtitle1\">",
"        Potential significance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diarrhea",
"       </td>",
"       <td>",
"        Malabsorption (celiac disease, cystic fibrosis, secondary lactase deficiency)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic constipation",
"       </td>",
"       <td>",
"        May cause decreased appetite",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recent travel to developing country, camping, housing in shelter, day care",
"       </td>",
"       <td>",
"        Infectious diarrhea (eg, giardiasis, nematodes, enteric pathogens)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic otitis media",
"       </td>",
"       <td>",
"        Immune deficiency; structural abnormality that impairs intake",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Snoring or mouth breathing",
"       </td>",
"       <td>",
"        Adenoidal hypertrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        History of wheezing",
"       </td>",
"       <td>",
"        Mechanical obstruction (eg, vascular ring), chronic pulmonary disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vomiting or spitting up",
"       </td>",
"       <td>",
"        Gastroesophageal reflux, delayed gastric emptying, intestinal obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gagging, tactile hypersensitivity, prolonged feeding time",
"       </td>",
"       <td>",
"        Oral motor dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polyuria, polydipsia, polyphagia",
"       </td>",
"       <td>",
"        Diabetes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Frequent infections",
"       </td>",
"       <td>",
"        Immune deficiency",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
